import React, { lazy, Suspense } from 'react';
import { Row, Col } from 'antd';
//import { GlobalLoading } from './../../components';
import { ToolPost } from './Components';
import './styles.css';

function Home(props) {
    return (
        <Row gutter={[16, 16]}>
            <Col lg={24}>
                <ToolPost />
            </Col>
        </Row>
    );
}
export default Home;
